import React from 'react';
import { Container, Box, Typography, Link } from '@mui/material';

const LandingPage = () => {
  return (
    <div>
      <Container maxWidth="lg">
        {/* Flexbox Container */}
        <Box
          style={{
            minHeight: '100vh',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'space-between', // Adjusted for spacing
          }}
        >
          {/* Left Side: Text Content */}
          <Box style={{ width: '50%', paddingLeft: '5%' }}>
            <Typography variant="h4">
              currently building,
            </Typography>
            <Typography variant="h4">
              hopefully cool things.
            </Typography>
            <Typography variant="body1" color="textSecondary">
              Hi, I'm Jack. I like building products in AI, crypto, and space. Hopefully something that helps people.
            </Typography>
            <Typography variant="body1" color="primary">
              <Link href="/projects">
                SEE MY PROJECTS ->
              </Link>
            </Typography>
          </Box>

          {/* Right Side: Image */}
          <Box style={{ width: '50%' }}>
            {/* Replace 'imageUrl' with the actual path to your image */}
            <img src="imageUrl" alt="Descriptive Alt Text" style={{ width: '100%', height: 'auto' }} />
          </Box>
        </Box>

        {/* Existing content */}
        <Box textAlign="center" my={4}>
          <Typography variant="h6">Interested in my work?</Typography>
          <Link href="/projects" color="primary">
            View My Projects
          </Link>
        </Box>
      </Container>
    </div>
  );
};

export default LandingPage;
